import React from "react";
import { useState } from "react";
import Button from "../Button/Button";
import { createParseUser } from "../../api/user";
import { queryBookingId } from "../../api/user";
import "../../App.css";
import "./ProfileForm.css";

export default function ProfileForm() {
  return (
    <div className="profile-form">
      <form>
        {/*Current Status*/}
        <div className="form-item">
          <div className="header">
            <label htmlFor="currentstatus">My current status:</label>
          </div>

          <input type="text" className="profile-input" id="currentstatus" />
        </div>

        {/*Nationality*/}
        <div className="form-item">
          <label htmlFor="nationality">Nationality:</label>
          <input type="text" className="profile-input" id="nationality" />
        </div>

        <div className="upload-profile-picture">
          <Button text="Upload Profile Photo" colors="dead" />
        </div>
      </form>
    </div>
  );
}
